#!/usr/bin/env python3
"""
Quick test script for the multi-agent vision endpoint.
Tests the /ma/chat/image endpoint with a sample image.
"""

import requests
import base64
from io import BytesIO
from PIL import Image
import json


def create_test_image():
    """Create a simple test image."""
    # Create a red square (simulating a skin condition)
    img = Image.new('RGB', (200, 200), color='red')
    
    # Convert to base64
    buffer = BytesIO()
    img.save(buffer, format='JPEG')
    img_bytes = buffer.getvalue()
    
    return base64.b64encode(img_bytes).decode('utf-8')


